import React from "react";
import Cards from "./Cards";
import Text from "./Text";
import "./style.css";
import Cards1 from "./Cards1";

const Tracks = () => {
	return (
		<div
			id="tracks"
			className="tracksContainer items-center flex max-w-[100vw] text-white bg-slate-900 snap-start"
		>
			<Text />
			{/* <Cards/> */}
			<Cards1 />
		</div>
	);
};

export default Tracks;

var a = document.querySelector("#Tracks .bg-slate-800");
a.addEventListener("mouseenter", () => {
	var tobeHidden = document.querySelector(".titlePara");
	tobeHidden.style.opacity = 0;
	var toBeDisplayed = document.querySelector(".para");
});
